import React, { Component } from "react";
import likelySensitive from "";
import alertIcon from "../../assets/logo/alert-icon.svg";

export default class HomePage extends Component {
  render() {
    return (
      <>
        <h1>WE THINK YOU MAY HAVE SENSITIVITIES TO:</h1>
        <img src={likelySensitive} />
        <section>
          <figure src={alertIcon}>
            .map trough ingredients that have been filtered
          </figure>
        </section>

        <button type="button" onClick={this.logout}>
          Log out
        </button>
      </>
    );
  }
}
